import React from 'react';

const Add = ({ location }) => {
  const selectedItem = location.state.selectedItem;

  return (
    <div>
      {selectedItem && (
        <div>
          <img src={selectedItem.img} alt={selectedItem.title} />
          <h3>{selectedItem.title}</h3>
        </div>
      )}
    </div>
  );
};

export default Add;
